import React from 'react';

export const Navbar = () => {
  return (
    <>
    <div className='categories'>
      <ul>
        <li>Elemento 1</li>
        <li>Elemento 2</li>
        <li>Elemento 3</li>
      </ul>
    </div>
    
    <div className="buttons">
        <button>Ofertas</button>
        <button>Historial</button>
        <button>Vender</button>
        <button>Ayuda</button>
    </div>
    </>
  );
}
